import React, { useState } from 'react';
import { ImageBackground, View, StyleSheet, Image, FlatList, Text, TouchableHighlight, Button } from 'react-native';
// https://stackoverflow.com/questions/45868284/how-to-get-currently-visible-index-in-rn-flat-list
const DATA = [
    {
        id: 'bd7acbea-c1b1-46c2-aed5-3ad53abb28ba',
        title: 'First Item',
        district_name: 'Burdwan',
        district_id: 1
    },
    {
        id: '3ac68afc-c605-48d3-a4f8-fbd91aa97f63',
        title: 'Second Item',
        district_name: 'Burdwan1',
        district_id: 2
    },
    {
        id: '58694a0f-3da1-471f-bd96-145571e29d72',
        title: 'Third Item',
        district_name: 'Burdwan3',
        district_id: 3
    },
    {
        id: 'bd7acbea-c1b1-46c2-aed5-3xd53abb28ba',
        title: 'Fourth Item',
        district_name: 'Burdwan4',
        district_id: 4
    },
    {
        id: '3ac68afc-c605-48d3-a4f8-fbh91aa97f63',
        title: 'Fifth Item',
        district_name: 'Burdwan5',
        district_id: 5
    },
    {
        id: '58694a0f-3da1-471f-bd96-145571e2yd72',
        title: 'Sixth Item',
        district_name: 'Burdwan6',
        district_id: 6
    },
];

const states = require('../data/states_districts1.json');



function WelcomeScreen({ navigation }) {
    const [currState, setCurrState] = useState("West Bengal");
    const [dist, setDist] = useState(0);
    const [distList, setdistList] = useState([]);
    var states_list = Object.keys(states).sort((a, b) => a - b);
    console.log(states[currState]);
    const StateItem = ({ props }) => (
        <TouchableHighlight onPress={() => {
            setCurrState(props);
        }}>
            <View style={styles.item}>
                <Text style={styles.title}>{props}</Text>
            </View>
        </TouchableHighlight>
    );

    const renderState = ({ item }) => (
        <StateItem props={item} />
    );

    const DistItem = ({ props }) => (
        <TouchableHighlight onPress={() => setDist(props.district_id)}>
            <View style={styles.item}>
                <Text style={styles.title}>{props.district_name}</Text>
            </View>
        </TouchableHighlight>
    );

    const renderDist = ({ item }) => (
        <DistItem props={item} />
    );

    return (
        <ImageBackground style={styles.background}
            source={require("../assets/background.jpg")}>
            <Image style={styles.logo} source={require("../assets/covid_logo4.png")} />
            <View style={styles.loginButton}>
                <FlatList
                    data={states_list}
                    snapToAlignment={'center'}
                    snapToInterval={150}
                    // decelerationRate={'fast'}
                    pagingEnabled={true}
                    renderItem={renderState}
                    keyExtractor={item => String(states[item].state_id)}
                    horizontal={true}
                    viewabilityConfig={{ itemVisiblePercentThreshold: 90 }}

                />
            </View>
            <View style={styles.signUpButton}>
                {/* <Text>{currState}</Text> */}
                <FlatList
                    data={states[currState].districts}
                    renderItem={renderDist}
                    snapToInterval={150}
                    keyExtractor={item => String(item.district_id)}
                    horizontal={true}
                    extraData={currState}
                />
            </View>
            <Button
                title="View Slots"
                onPress={() => navigation.navigate('SlotResults', { "State_name": currState, "District_id": dist })}
            />
        </ImageBackground>
    );
}
const styles = StyleSheet.create({
    background: {
        flex: 1,
        flexDirection: "column",
        justifyContent: "flex-end",
        alignItems: "center"
    },
    loginButton: {
        width: "100%",
        height: 70,
        backgroundColor: "blue"
    },
    signUpButton: {
        width: "100%",
        height: 70,
        backgroundColor: "green"
    },
    logo: {
        width: "30%",
        height: "15%",
        resizeMode: "center",
        // borderWidth: 2,
        borderColor: "blue",
        top: "20%",
        position: "absolute"
    },
    item: {
        // backgroundColor: "cyan",
        color: "white",
        marginRight: 10,
        width: 90
    },
    title: {
        color: "white",
        borderColor: "red",
        // borderWidth: 2
    }
})
export default WelcomeScreen;
